func TestEqualPairs(t *testing.T) {
	for i, v := range tests {
		t.Log("test: ", i+1)
		got := equalPairs_leet71ms(v.nums)
		assert.Equal(t, v.expected, got)
	}
}

func BenchmarkEqualPairs(b *testing.B) {
	funcs := []struct {
		name string
		f    func([][]int) int
	}{
		{"mine", equalPairs},
		{"leet-fastest", equalPairs_leet71ms},
	}

	var res int
	for _, fun := range funcs {

		b.Run(fun.name, func(b *testing.B) {
			b.ReportAllocs()
			b.ResetTimer()
			for k := 0; k < b.N; k++ {
				res = fun.f(tests[k%len(tests)].nums)
			}
		})
	}

	result = res
}
